import React, { Component } from "react";
import Product from "./product";

export default class Catalog extends Component {
  renderTile = () => {
    return (
      <div class="column is-one-quarter">
        <Product />
      </div>
    );
  };
  render() {
    let tiles = [];
    for (let i = 0; i < 8; i++) {
      tiles.push(this.renderTile());
    }
    return <div class="columns">{tiles}</div>;
  }
}
